Bacchus1_Desc=Super-Terre située près des étoiles binaires du système, causant l'ébullition de sa surface rocheuse et la formation d'une atmosphère extrêmement chaude et trouble.
Bacchus2=Bacchus II
Bacchus2_Desc=Une planète océanique parsemée de nombreuses îles et archipels occupés, présentant une grande variété de climats et de biodiversité. Bien que les Banu n'aient pas encore confirmé que Bacchus II était leur planète d'origine comme le prétendent certains membres de l'UEE, il est bien connu que la planète accueille le "Rassemblement" : un événement spécial au cours duquel les Banu se réunissent pour prendre des décisions relatives à l'ensemble de leur espèce.
Bacchus3_Desc=Une géante gazeuse caractérisée par des nuages tourbillonnants dynamiques et des orages électriques fréquents.
Bacchus_AsteroidBelt1_Desc=Surexploitée pendant des générations par les Banu, cette ceinture d'astéroïdes est devenue une décharge au fil du temps.
Bacchus_Desc=Beaucoup dans l'UEE pensent que le monde natal des Banu se trouve dans le système binaire Bacchus, bien que les Banu eux-mêmes n'ont pas pu ou souhaité confirmer cette hypothèse. Comme dans la plupart des systèmes Banu, les routes commerciales y sont en permanence chargées de voyageurs Banu, Humains et Xi'an. Une importante flotille se trouve en permanence dans la bordure extérieure du système, destination de choix pour les transporteurs et le marchands.
