Castra_Desc=Zone de transit pour les vaisseaux bombardiers, Castra était une position militaire clé le long de la ligne Perry pendant les tensions entre Xi'an et les humains entre 2530 et 2789. Une fois le Traité d'Akari reconnu par l'Empereur Toi, l'armée de l'UEE a largement démilitarisé le système et l'a ouvert à l'habitation publique. Castra a connu un boom démographique grâce à l'immobilier bon marché qui s'est ouvert à la suite du départ des militaires.\n
