TarPits_TimedSalvage_Desc_02_ChickenShip=Nous avons appris qu'Adagio avait un contrat de sauvetage à venir pour une ~mission(ship). Si vous souhaitez intervenir, nous pouvons vous vendre les coordonnées pour un rabais intéressant. Il faut cependant décider vite.\n\nCertains récupérateurs malchanceux achèteront probablement bientôt les droits sur la concession, mais nous pensons qu'il leur faudra au moins ~minutes de mission(timed) avant d'y arriver. S'ils vous voient s'en prendre à leur réclamation, ils pourraient appeler la sécurité, mais si vous êtes bon, vous devriez avoir suffisamment de temps. Et si vous êtes lent, je suppose que vous pouvez simplement les abattre avant qu'ils n'envoient un message à qui que ce soit, n'est-ce pas ?
