Tut01_Hint02_Movement=Pour regarder autour de vous, utilisez [~action(player|rotatepitch)] et [~action(player|rotateyaw)].\nPour vous déplacer, utilisez [~action(player|moveforward)] [~action(player|moveleft)] [~action(joueur|moveback)] [~action(joueur|moveright)].
