Tut01_Hint02a_Mobiglas=Votre ordinateur personnel mobiGlas dispose d'un journal dans lequel les informations et documents utiles sont conservés.\nAppuyez sur [~action(player|mobiglas)] pour accéder à votre mobiGlas et, dans la rangée d'icônes du bas, sélectionnez l'application Journal.
