Tut02_Hint04a_Kiosks=Utilisez le mode d'interaction [~action(player_choice|pc_interaction_mode)] pour parcourir les kiosques d'achat et acheter ou vendre des articles.\nÉloignez-vous du kiosque pour quitter l'interface.
