Tut03_Part02_Hint03_ToHangar=Observez le marqueur de vaisseau sur votre HUD pour vérifier le hangar où il est actuellement stationné. Ensuite, utilisez les ascenseurs du hangar du spatioport pour atteindre le hangar approprié.
Tut03_Part02_Hint03_ToHangar_Title=Hangar à vaisseaux
Tut03_Part02_Hint04_BoardShip=Approchez-vous du vaisseau et utilisez le mode d'interaction [~action(player_choice|pc_interaction_mode)] pour abaisser la rampe. \nN'oubliez pas de fermer la rampe derrière vous.
