UDM_LocalDelivery_desc_05=Salutations Partenaire d'expédition qualifié !\n\nÊtes-vous à la recherche d'une nouvelle carrière passionnante dans le confort de votre propre navire prêt à être cargo ? Alors l'itinéraire suivant est peut-être exactement l'opportunité que vous recherchiez -\n\nPACKAGES À RAMASSER (TOUTE COMMANDE)\n · Forfait #~mission(item1|serialnumber) de ~mission(Pickup1|Adresse)\n · Package #~mission(item2|serialnumber) de ~mission(Pickup2|Address)\n · Package #~mission(item3|serialnumber) de ~mission(Pickup3|Address)\n · Package #~mission(item4|serialnumber) de ~mission(Pickup4|Adresse)\n · Forfait n°~mission(item5|serialnumber) de ~mission(Pickup5|Address)\n\nLIEUX DE DÉPÔT (TOUTE COMMANDE)\n · Forfait n°~mission(item1|serialnumber) à ~mission(Dropoff1|Address)\n · Package #~mission(item2|serialnumber) à ~mission(Dropoff2|Address)\n · Package #~mission(item3|serialnumber) à ~mission(Dropoff3|Address)\n · Package #~mission(item4|serialnumber) à ~mission(Dropoff4|Address)\n · Package #~mission(item5|serialnumber) à ~mission(Dropoff5|Address)\n\nTout ce que vous avez à faire est d'accepter le contrat et vous serez sur la bonne voie.\n\nAu plaisir de travailler avec vous,\n\nGestion unifiée de la distribution\n -Fournir le package complet-
UDM_LocalDelivery_desc_rehire=Salutations, ancien partenaire maritime qualifié !\n\nPrêt à avoir une autre chance d'utiliser votre navire prêt à être transporté pour gagner des crédits ? Unified Distribution Management a choisi l'itinéraire suivant soigneusement sélectionné comme moyen idéal pour réévaluer vos compétences -\n\nCOLIS À RAMASSER (TOUTE COMMANDE)\n · Colis #~mission(item1|serialnumber) de ~mission(Pickup1|Address)\n · Colis #~mission(item2|serialnumber) de ~mission(Pickup2|Adresse)\n · Colis #~mission(item3|serialnumber) de ~mission(Pickup3|Address)\n\nEMPLACEMENTS DE DÉPÔT (TOUS LES COMMANDE)\n · Colis #~mission(item1|serialnumber) à ~mission(Dropoff1|Address)\n · Colis #~mission(item2|serialnumber) à ~mission(Dropoff2|Address)\n · Colis #~mission( item3|serialnumber) à ~mission(Dropoff3|Address)\n\nAu plaisir de travailler à nouveau avec vous,\n\nGestion unifiée de la distribution\n -Livraison totale-
