ui_pregame_persistentuniverse_desc=Rejoignez vos amis dans l'univers de Star Citizen, explorez des astres, gagnez des aUECs pour vous acheter des vaisseaux et de l'équipement, le tout dans un univers persistant et multijoueur !
ui_pregame_port_GrimHex_desc=Une base avec des logements bon marché (également connue sous le nom de HEX) construite dans un astéroïde évidé pour offrir une vie abordable. À mesure que les opportunités minières se tarissaient, la station déclina et se transforma lentement en un marché de drogue et de petite délinquance. Les habitants appellent désormais la station Grim HEX.
